script: |
  super -f text -I q943.spq | sort > q943.out

inputs:
  - name: q943.spq
    data: |
      SELECT col2 + + col0 AS col2 FROM tab2 (FORMAT parquet) WHERE + col2 + - col2 NOT BETWEEN - col0 * + col2 + + col0 AND - col2 * + col2;
  - name: tab2

outputs:
  - name: q943.out
    data: |
      104
      117
      34
